import Head from 'next/head';
import Avatar from 'react-avatar';
export default ({children,title}) => (
    <div>
    <Head>
    <link href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css" rel="stylesheet" />
    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css"/>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/js/bootstrap.min.js"></script>
    <title>LiveIzy-{title}</title>
    </Head>
        <div className="container-fluid">
            <div className='row'>
                <div className='col-md-2 col-12'>
                    <header>
                        <nav className="navbar bg-primary navbar-dark">
  
                            <a className="navbar-brand" href="#"><img src='logo.png'className='img-logo'/></a>
                            

                            <div className='avartar-cov mx-auto'>
                                <Avatar src='/default-avatar.png' size='100' round={true}/>
                                <h4>Oleka Olechi</h4>
                                <p>UVBA1591</p>
                            </div>

                            
                            <ul className="navbar-nav">
                                <li className="nav-item">
                                    <span>
                                        <img src='/dashboard.svg'className='liChildren'/>
                                        <a className="nav-link ml-n4" href="#">DASHBOARD</a>
                                    </span>
                                </li>
                                 <li className="nav-item dropdown">
                                    <span>
                                        <img src='/home-run.svg'className='liChildren'/>
                                        <a className="nav-link dropdown-toggle ml-n4" href="#" id="navbardrop" data-toggle="dropdown">
                                        
                                            PROPERTIES
                                        </a>
                                            <div className="dropdown-menu">
                                                <a className="dropdown-item" href="#">Link 1</a>
                                                
                                            </div>
                                    </span>
                                </li>
                                 <li className="nav-item">
                                    <span>
                                        <img src='/wallet.svg' className='liChildren'/>
                                        <a className="nav-link ml-n4" href="#">WALLET</a>
                                    </span>
                                </li>
                                <li className="nav-item">
                                    <span>
                                        <img src='information.svg'className='liChildren'/>
                                        <a className="nav-link ml-n4" href="#">APPLICATIONS</a>
                                    </span>
                                </li>
                                 <li className="nav-item">
                                    <span>
                                        <img src='/user1.svg'className='liChildren'/>
                                        <a className="nav-link ml-n4" href="#">LPMS</a>
                                    </span>
                                </li>
                                 <li className="nav-item">
                                    <span>
                                        <img src='/wage.svg' className=' liChildren'/>
                                        <a className="nav-link ml-n4" href="#">INCOME</a>
                                    </span>
                                </li>
                                 <li className="nav-item">
                                    <span>
                                        <img src='/owner.svg'className='liChildren'/>
                                        <a className="nav-link ml-n4" href="#">TENANTS</a>
                                    </span>
                                </li>
                                 <li className="nav-item">
